import React from 'react';

class Footer extends React.Component {
    render() {
        return(
            <div>
                <footer>
                    <p className="text-center"><small className="text-muted">Copyright &copy; 2019 Tan Siew Ling - All Rights Reserved.</small></p>
                </footer>
            </div>
        );
    }
}

export default Footer;
